Let me think through this step by step...

**Key Psychological Mechanisms:**

The key psychological mechanisms involved in a responder's decision to accept or reject an offer in this bargaining game are fairness and self-interest.  Responders likely consider both the absolute amount they receive and the fairness of the split relative to their contribution (tokens) compared to the opponent's contribution.  Inequity aversion is a prominent factor here.  A highly unequal split, even if favorable to the responder, might be rejected due to a sense of unfairness.

**How These Mechanisms Interact:**

Self-interest suggests that responders will primarily focus on maximizing their monetary gain (`split_self`). However, fairness considerations based on the ratio of their contribution to the opponent's contribution (`token_self` / `token_opp`) will moderate this self-interest. A perceived unfair split (where the ratio of received money is significantly different from the ratio of token contributions), even if personally advantageous, could lead to rejection.

**Mathematical Form:**

We can capture this interaction using a utility function that balances self-interest and fairness. A simple model can use a weighted linear combination of these two factors.  We can represent fairness by simply normalizing the difference between one's proportional share and the opponent's proportional share relative to the ratio of their tokens. This normalizes the difference according to the relative contributions, avoiding the influence of differing absolute contributions in the money variable.


**Parameters:**

The model requires two learnable parameters:

1.  `self_interest_weight`: This parameter represents the relative importance of self-interest in the responder's decision-making. Higher values indicate a greater focus on maximizing personal gain.
2.  `fairness_weight`: This parameter represents the relative importance of fairness. Higher values indicate a stronger aversion to unequal splits.

**How Model Variables Map to Observable Behavior:**

The model uses `split_self`, `token_self`, and `token_opp` from the dataset.  The utility function calculates the overall utility of accepting an offer. A higher utility corresponds to a higher likelihood of acceptance.  A temperature parameter (not included in this model) would be used later to control the stochasticity of the acceptance decision.

