def simulate_model(trial_data, self_interest_weight=1, fairness_weight=1):
    utility_values = []
    for trial in trial_data:
        split_self = trial.get("split_self", 0)
        token_self = trial.get("token_self", 1) # Handle potential division by zero
        split_opp = trial.get("split_opp", 0)
        token_opp = trial.get("token_opp", 1) # Handle potential division by zero

        if token_self == 0 or token_opp ==0:
          utility = self_interest_weight * split_self
        else:
          utility = self_interest_weight * split_self + fairness_weight * ((split_self / token_self) - (split_opp / token_opp))
        utility_values.append(utility)
    return utility_values
